import React, { Component } from 'react';
import { StyleSheet, Text, View } from 'react-native';

export default function ReviewDetails(){
  return(
    <View>
      <Text>Review Details</Text>
    </View>
  )
}

const styles = StyleSheet.create({
  screen: {
    flex: 1
  }
})
